import React from 'react';
import { useState, useEffect } from 'react';

function Header(props) {
  return (
    <div className='Header'>
      <h1>PiePoker</h1>
      <h2>Your Games</h2>
      <h2>Register</h2>
      <h2>Log in</h2>
      <h3>Log out</h3>
    </div>
  )
}

export default Header
